import React, { Component } from "react";
import './body.css'


class Body extends Component
{
    render()
    {
        return(
            <div className="page-holder bg-cover">

                <div className="container py-5 ">
                    <header className="text-center text-grey py-5 animate__animated animate__fadeInUpBig ">
                        <h4 className="display-4 font-weight-bold mb-4">Wallet As A Service</h4>
                    </header>

                    <div className="card box_shw2 border-0 px-3 rounded-2 mb-3 w_400 py-4 mx-auto mt-5">

                        <h3>WAAS Account login</h3>
                        <div className="form-group">
                        <input type="text" className="form-control" placeholder="Enter username" required="required" id="name" name="name" v/>

                            <input type="password" className="form-control" placeholder="Enter password" required="required" id="password" name="password" />
                        </div>


                    </div>

                    <a href={"/log"}><button style={{fontSize:'50px'}} className="abtn btn-dark floatleft btn-xxl"  >Log In</button></a>

                    <a href={"/register"}><button style={{fontSize:'50px'}} className="abtn btn-dark floatright btn-xxl btn-lg">Register</button></a>

                </div>

            </div>
        )
    }
}
export default Body;

